                onCancel={() => setOpenSearch(false)}
                content={<SearchPage setOpenSearch={setOpenSearch}/>}
            />
            {/*<OverlaySettings*/}
            {/*    onClose={() => setOpenFilter(false)}*/}
            {/*    openSettings={openFilter}*/}
            {/*    content={<Filter/>}*/}
            {/*/>*/}
            <Header
                setOpenSearch={setOpenSearch}
            />
            <HomeContent>
                <HomeContentView/>
            </HomeContent>
        </>
    )
}
